import { Link } from "react-router-dom"


export default function BoardList ({data}){

    return (
        <>
        <ul className="boardList">
            <li><span>구분</span><p>제목</p><span>작성일</span><span>조회수</span></li>
            <ol>
                {data.map((el) => {<li key={el.date}><Link><span>{el.type}</span><p>{el.title}</p><span>{el.date}</span>{el.views}</Link></li>})}
            </ol>
        </ul>
        </>
    )
}
